$templateCache.put("views/privacy-policy.html","<perfect-scrollbar offset=\"50\" handle-keyboard=\"true\"><div ng-class=\"containerClass\"><div class=\"col-md-12 p-b-50\"><h3 class=\"text-primary\">PRIVACY POLICY</h3><p class=\"text-primary\">  This privacy policy has been compiled to better serve those who are concerned with how their \'Personally identifiable information\' (PII) may be collected or used online by Pour Your Cup PBC.</p><p class=\"m-l-10\">	PII, as used in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context.</p><p class=\"m-l-10\">	The Google Play Developer Distribution Agreement also requires that we protect the privacy and legal rights of users, See: Google Inc. “Google Play Developer Distribution Agreement” (6 July 2016) Google Play <https://play.google.com/about/developer-distribution-agreement.html> at 4.3.</p><p class=\"text-primary\">	Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website and mobile applications.</p><h4 class=\"text-primary text-primary\">INFORMATION COLLECTION</h4><p class=\"text-primary\">	What personal information do we collect from the people that visit our blog, website or app?</p><p class=\"m-l-10\">	When registering on our site, as appropriate, you may be asked to enter your name, email address or other details to help you with your experience.</p><p class=\"m-l-10\">	\'Other details\' for our application includes affiliations to high schools, universities and other organizations considered to be networks for the purpose of our application.</p><p class=\"text-primary\">	When do we collect information?</p><p class=\"m-l-10\">	We collect information from you when you enter information on our site or mobile application.<br/>  We collect information when you allow permission for access to resources on your device for use by the application such as taking photos with the camera within the application.<br/>	We collect information when you register your account using an external account for authentication giving to access profile information associated with that third party account.</p><h4 class=\"text-primary\">INFORMATION USAGE</h4><p class=\"text-primary\">	How do we use your information?</p><p class=\"m-l-10\">	We may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways:</p><ul><li>To personalize user\'s experience and to allow us to deliver the type of content and product offerings in which you are most interested relating to the application\'s scope and purpose.</li></ul><h4 class=\"text-primary\">INFORMATION PROTECTION</h4><p class=\"text-primary\">	How do we use your information?</p><ul><li>We do not use vulnerability scanning and/or scanning to PCI standards.</li><li>We do not use Malware Scanning.</li><li>We do not use an SSL certificate</li></ul><h4 class=\"text-primary\">COOKIE USAGE</h4><p class=\"text-primary\">	Do we use \'cookies\'?</p><p class=\"m-l-10\">	Yes. Cookies are small files that a site or its service provider transfers to your computer\'s hard drive through your Web browser (if you allow) that enables the site\'s or service provider\'s systems to recognize your browser and capture and remember certain information. They are also used to help us understand your preferences based on previous or current site activity, which enables us to provide you with improved services. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.</p><p class=\"text-primary\">	We use cookies to:</p><ul><li>Understand and save user\'s preferences for future visits.</li><li>Compile aggregate data about site traffic and site interactions in order to offer better site experiences and tools in the future. We may also use trusted third party services that track this information on our behalf.</li></ul><p class=\"m-l-10\">	You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer) settings. Each browser is a little different, so look at your browser\'s Help menu to learn the correct way to modify your cookies.<br/>	If you disable cookies off, some features will be disabled It won\'t affect the users experience that make your site experience more efficient and some of our services will not function properly.</p><h4 class=\"text-primary\">3RD PARTY DISCLOSURE</h4><p class=\"text-primary\">	Third Party Disclosure</p><p class=\"m-l-10\">	We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information.</p><h4 class=\"text-primary\">3RD PARTY LINKS</h4><p class=\"text-primary\">	Third party links</p><p class=\"m-l-10\">	A third party link is defined as a link to a website that we do not own and control. We take moderation and quality control seriously for any issue that may arise with third party links. However, this Privacy Policy does not cover any access made by users to Third Party Links from our website or mobile applications and entities access from these links may have a different privacy policy.</p><h4 class=\"text-primary\">GOOGLE ADSENSE</h4><p class=\"text-primary\">	Usage</p><p class=\"m-l-10\">	Google\'s advertising requirements can be summed up by Google\'s Advertising Principles. They are put in place to provide a positive experience for users. https://support.google.com/adwordspolicy/answer/1316548?hl=en<br/>	We use Google AdSense Advertising on our website.<br/>	Google, as a third party vendor, uses cookies to serve ads on our site. Google\'s use of the DART cookie enables it to serve ads to our users based on their visit to our site and other sites on the Internet. Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy.<br/>	We have implemented the following:</p><ul><li>Google Display Network Impression Reporting</li><li>Demographics and Interests Reporting</li><li>DoubleClick Platform Integration</li></ul><p class=\"m-l-10\">	We along with third-party vendors, such as Google use first-party cookies (such as the Google Analytics cookies) and third-party cookies (such as the DoubleClick cookie) or other third-party identifiers together to compile data regarding user interactions with ad impressions, and other ad service functions as they relate to our website.</p><p class=\"text-primary\">	Opting out:</p><p class=\"m-l-10\">	Users can set preferences for how Google advertises to you using the Google Ad Settings page. Alternatively, you can opt out by visiting the Network Advertising initiative opt out page or permanently using the Google Analytics Opt Out Browser add on.</p><h4 class=\"text-primary\">CALIFORNIA ONLINE PRIVACY PROTECTION ACT</h4><p class=\"text-primary\">	Information</p><p class=\"m-l-10\">	CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law\'s reach stretches well beyond California to require a person or company in the United States (and conceivably the world) that operates websites collecting personally identifiable information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals with whom it is being shared, and to comply with this policy. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf</p><p class=\"text-primary\">	According to CalOPPA we agree to the following:</p><ul><li>Users can visit our site anonymously</li><li>Once this privacy policy is created, we will add a link to it on our home page, or as a minimum on the first significant page after entering our website.</li><li>Our Privacy Policy link includes the word \'Privacy\', and can be easily be found on the page specified above.</li></ul><p class=\"text-primary\">	Users will be notified of any privacy policy changes:</p><p class=\"m-l-10\">	On our Privacy Policy Page.<br/>	Users are able to change their personal information:</p><ul><li>By emailing us</li><li>By logging in to their account</li></ul><p class=\"text-primary\">	How does our site handle do not track signals?</p><p class=\"m-l-10\">	We honor do not track signals and do not track, plant cookies, or use advertising when a Do Not Track (DNT) browser mechanism is in place.</p><p class=\"text-primary\">	Does our site allow third party behavioral tracking?</p><p class=\"m-l-10\">	It\'s also important to note that we do not allow third party behavioral tracking</p><h4 class=\"text-primary\">COPPA</h4><p class=\"text-primary\">	Children Online Privacy Protection Act</p><p class=\"m-l-10\">	When it comes to the collection of personal information from children under 13, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, the nation\'s consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online.<br/>	We do not specifically market to children under 13.</p><h4 class=\"text-primary\">CAN-SPAM</h4><p class=\"text-primary\">	CAN SPAM Act</p><p class=\"m-l-10\">	The CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.</p><p class=\"text-primary\">	We collect your email address in order to:</p><ul><li>Send information, respond to inquiries, and/or other requests or questions.</li><li>Market to our mailing list or continue to send emails to our clients after the original transaction has occurred</li></ul><p class=\"text-primary\">	To be in accordance with CANSPAM we agree to the following:</p><ul><li>NOT use false, or misleading subjects or email addresses</li><li>Identify the message as an advertisement in some reasonable way</li><li>Include the physical address of our business or site headquarters</li><li>Monitor third party email marketing services for compliance, if one is used.</li><li>Honor opt-out/unsubscribe requests quickly</li><li>Allow users to unsubscribe by using the link at the bottom of each email</li></ul><p class=\"m-l-10\">	If at any time you would like to unsubscribe from receiving future emails, you can email us at hello@pouryourcup.com</p></div></div><div ng-if=\"media_query != \'tablet\'\" class=\"col-md-12 col-lg-8 col-lg-offset-2 text-center p-b-50\"><button ng-click=\"leave()\" class=\"btn pycbtn-success m-5 wd-lg\">GO BACK</button></div></perfect-scrollbar><div ng-if=\"media_query == \'tablet\'\" class=\"col-md-12 p0 text-center height-50\"><button ng-click=\"leave()\" class=\"btn pycbtn-success height-50 col-xs-12\">GO BACK</button></div>");
